import React from 'react'

import Particles from 'react-particles-js';

export default class App extends React.Component{

    render(){
        return (
            <Particles 
                params={{
                    polygon: {
                        enable: true,
                        type: 'inside',
                        move: {
                            radius: 10
                        },
                        url: './images/headphones.jpg'
                    }
                }} />
        );
    };

}
